import React, { Fragment } from "react";
import "../../styled/StartProject.css";
import { Link } from "react-router-dom";
import repositorio from "../../components/img/Respositores.png";
import crearRepositorio from "../../components/img/crearRepositorio.png";

const StartProject = () => {
  return (
    <Fragment>
      <ul>
        <li>
          <Link to="/">Inicio</Link>
        </li>
      </ul>
      <ol>
        Empezar un proyecto:
        <ol>
          <li>Crear un repositorio nuevo</li>
        </ol>
        <ol>Crear una carpeta local donde guardaremos el proyecto</ol>
        <ol>Abir esta carpeta con tu terminal</ol>
        <ol>Nombre carpeta % "git init"</ol>
        <ol>Nombre carpeta % "git remote add origin https://git..."</ol>
        <ol>Nombre carpeta % "git pull origin main"</ol>
        <ol>Nombre carpeta % "git branch main"</ol>
        <ol>Nombre carpeta % "git checkout main"</ol>
        <ol>Nombre carpeta % ""</ol>
      </ol>
    </Fragment>
  );
};

export default StartProject;
